import React, { useState, useEffect } from "react";
import css from "@emotion/css";
import { Formik } from "formik";
import * as Yup from "yup";
import Cookies from "js-cookie";
import { useSnackbar } from "react-simple-snackbar";
import * as STYLES from "../../../components/General/modalStyles";
import { updateConfDetails } from "../../../services/profileService";

const ConferenceModal = ({ openModal, confData, closeModal }) => {
  console.log("confData", confData);
  const ProfileId = Cookies.get("employeeID");
  const [openSnackbar, closeSnackbar] = useSnackbar();

  //YUP validation schema
  const confUpdateSchema = Yup.object().shape({
    typeOfconferencename: Yup.string().required("Required"),
    titleConference: Yup.string().required("Required"),
    internationalNational: Yup.string().required("Required"),
    organizedBy: Yup.string().required("Required"),
    confMonYear: Yup.string().required("Required"),
    typeOfIssn: Yup.string().required("Required"),
    issnIsbnNo: Yup.string().required("Required"),
    typeOfissue: Yup.string().required("Required"),
    issueNo: Yup.string().required("Required"),
    depart: Yup.string(),
    conferenceID: Yup.string(),
  });

  const confernceName = ["Choose your option", "Conference", "Seminar"];
  const categoryConference = [
    "Choose your option",
    "National Conference",
    "International Conference",
  ];
  const issnNums = ["Choose your option", "ISSN", "ISBN"];
  const issueNums = ["Choose your option", "SCOPUS", "Wos", "ICI", "UGC"];
  return (
    <STYLES.PopupMask>
      <STYLES.PopupWrapper>
        <STYLES.PopupTitle>Conference Details</STYLES.PopupTitle>
        <Formik
          initialValues={{
            typeOfconferencename: confData?.typeOfconferencename,
            titleConference: confData?.titleConference,
            internationalNational: confData?.internationalNational,
            organizedBy: confData?.organizedBy,
            confmonthYear: confData?.conferenceMonthYear,
            issntype: confData?.typeOfIssn,
            issnIsbnNo: confData?.issnIsbnNo,
            issuetype: confData?.typeOfissue,
            issueNo: confData?.typeOfIssn,
            deptId: undefined,
            conferenceID: confData?.conferenceID,
          }}
          validationSchema={confUpdateSchema}
          onSubmit={(values) => {
            updateConfDetails(ProfileId, values).then((data) => {
              if (data) {
                openSnackbar("Conference Details updated successfully.");
                closeModal();
                console.log(data);
              }
            });
          }}
        >
          {({
            values,
            errors,
            touched,
            handleChange,
            handleBlur,
            handleSubmit,
          }) => (
            <form onSubmit={handleSubmit}>
              <div className="clearfix mb-3">
                <div className="w-6/12 float-left pr-2">
                  <label htmlFor="typeOfconferencename">
                    Name of the Conference/Seminars
                    <select
                      id="typeOfconferencename"
                      name="typeOfconferencename"
                      onChange={handleChange}
                      onBlur={handleBlur}
                      value={values.typeOfconferencename}
                      className="border border-2 border-solid p-2 rounded w-full focus:outline-none"
                      css={
                        errors.typeOfconferencename &&
                        touched.typeOfconferencename &&
                        errors.typeOfconferencename &&
                        css`
                          border: 1px solid red;
                        `
                      }
                    >
                      {confernceName &&
                        confernceName.map((opt) => (
                          <option
                            key={opt}
                            value={
                              values.typeOfconferencename === opt
                                ? values.typeOfconferencename
                                : opt
                            }
                            selected={
                              values.typeOfconferencename === opt
                                ? values.typeOfconferencename
                                : opt
                            }
                          >
                            {opt}
                          </option>
                        ))}
                    </select>
                  </label>
                </div>
                <div className="w-6/12 float-left">
                  Title Of The Paper
                  <label htmlFor="titleConference">
                    <input
                      type="text"
                      id="titleConference"
                      name="titleConference"
                      onChange={handleChange}
                      onBlur={handleBlur}
                      value={values.titleConference}
                      placeholder="Title Of The Paper"
                      className="border border-2 border-solid p-2 rounded w-full focus:outline-none "
                      css={
                        errors.titleConference &&
                        touched.titleConference &&
                        errors.titleConference &&
                        css`
                          border: 1px solid red;
                        `
                      }
                    />
                  </label>
                </div>
              </div>

              <div className="clearfix mb-3">
                <div className="w-6/12 float-left pr-2">
                  <label htmlFor="internationalNational">
                    Category Of Conference
                    <select
                      name="internationalNational"
                      id="internationalNational"
                      onChange={handleChange}
                      onBlur={handleBlur}
                      value={values.internationalNational}
                      className="border border-2 border-solid p-2 rounded w-full focus:outline-none"
                      css={
                        errors.internationalNational &&
                        touched.internationalNational &&
                        errors.internationalNational &&
                        css`
                          border: 1px solid red;
                        `
                      }
                      css={css`
                        height: 42px;
                      `}
                    >
                      {categoryConference &&
                        categoryConference.map((opt) => (
                          <option
                            key={opt}
                            value={
                              values.internationalNational === opt
                                ? values.internationalNational
                                : opt
                            }
                            selected={
                              values.internationalNational === opt
                                ? values.internationalNational
                                : opt
                            }
                          >
                            {opt}
                          </option>
                        ))}
                    </select>
                  </label>
                </div>
                <div className="w-6/12 float-left ">
                  <label htmlFor="organize">
                    Organized By
                    <input
                      type="text"
                      id="organize"
                      name="organize"
                      onChange={handleChange}
                      onBlur={handleBlur}
                      value={values.organize}
                      placeholder="Organized By"
                      className="border border-2 border-solid p-2 rounded w-full focus:outline-none "
                      css={
                        errors.organize &&
                        touched.organize &&
                        errors.organize &&
                        css`
                          border: 1px solid red;
                        `
                      }
                    />
                  </label>
                </div>
              </div>

              <div className="clearfix mb-3">
                <div className="w-6/12 float-left pr-2">
                  <label htmlFor="confmonthYear">
                    Month & Year
                    <input
                      type="date"
                      name="confmonthYear"
                      onChange={handleChange}
                      onBlur={handleBlur}
                      value={values.confmonthYear}
                      placeholder="Month & Year"
                      className="border border-2 border-solid p-2 rounded w-full focus:outline-none "
                      css={
                        errors.confmonthYear &&
                        touched.confmonthYear &&
                        errors.confmonthYear &&
                        css`
                          border: 1px solid red;
                        `
                      }
                    />
                  </label>
                </div>

                <div className="w-6/12 float-left">
                  <label htmlFor="issntype">
                    ISSN/ISBN Number
                    <select
                      name="issntype"
                      id="issntype"
                      onChange={handleChange}
                      onBlur={handleBlur}
                      value={values.issntype}
                      className="border border-2 border-solid p-2 rounded w-full focus:outline-none"
                      css={
                        errors.issntype &&
                        touched.issntype &&
                        errors.issntype &&
                        css`
                          border: 1px solid red;
                        `
                      }
                    >
                      {issnNums &&
                        issnNums.map((opt) => (
                          <option
                            key={opt}
                            value={
                              values.issntype === opt ? values.issntype : opt
                            }
                            selected={
                              values.issntype === opt ? values.issntype : opt
                            }
                          >
                            {opt}
                          </option>
                        ))}
                    </select>
                  </label>
                </div>
              </div>

              <div className="clearfix mb-3">
                <div className="w-6/12 float-left pr-2">
                  <label htmlFor="issnIsbnNo">
                    issnIsbnNo
                    <input
                      type="text"
                      name="issnIsbnNo"
                      onChange={handleChange}
                      onBlur={handleBlur}
                      value={values.issnIsbnNo}
                      placeholder="Type of ISSN"
                      className="border border-2 border-solid p-2 rounded w-full focus:outline-none"
                      css={
                        errors.issnIsbnNo &&
                        touched.issnIsbnNo &&
                        errors.issnIsbnNo &&
                        css`
                          border: 1px solid red;
                        `
                      }
                    />
                  </label>
                </div>

                <div className="w-6/12 float-left">
                  <label htmlFor="issuetype">
                    Issue No
                    <select
                      name="issuetype"
                      id="issuetype"
                      onChange={handleChange}
                      onBlur={handleBlur}
                      value={values.issuetype}
                      className="border border-2 border-solid p-2 rounded w-full focus:outline-none"
                      css={
                        errors.issuetype &&
                        touched.issuetype &&
                        errors.issuetype &&
                        css`
                          border: 1px solid red;
                        `
                      }
                    >
                      {issueNums &&
                        issueNums.map((opt) => (
                          <option
                            key={opt}
                            value={
                              values.issuetype === opt ? values.issuetype : opt
                            }
                            selected={
                              values.issuetype === opt ? values.issuetype : opt
                            }
                          >
                            {opt}
                          </option>
                        ))}
                    </select>
                  </label>
                </div>
              </div>

              <div className="clearfix mb-3">
                <div className="w-Full">
                  <label htmlFor="issueNo">
                    Type Of issue
                    <input
                      type="text"
                      name="issueNo"
                      onChange={handleChange}
                      onBlur={handleBlur}
                      value={values.issueNo}
                      placeholder=" Issue No"
                      className="border border-2 border-solid p-2 rounded w-full focus:outline-none"
                      css={
                        errors.issueNo &&
                        touched.issueNo &&
                        errors.issueNo &&
                        css`
                          border: 1px solid red;
                        `
                      }
                    />
                  </label>
                </div>
              </div>

              <div className="float-right">
                <button
                  type="submit"
                  className="bg-green-400 px-3 py-2 rounded text-white"
                >
                  Save Conference Details
                </button>
                <button
                  type="button"
                  onClick={closeModal}
                  className="bg-black px-3 py-2 ml-2 rounded text-white"
                >
                  Close
                </button>
              </div>
            </form>
          )}
        </Formik>
      </STYLES.PopupWrapper>
    </STYLES.PopupMask>
  );
};
export default ConferenceModal;
